// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

// ==================== External Imports ====================

import {AccessControl} from "@openzeppelin/contracts/access/AccessControl.sol";

// ==================== Internal Imports ====================

import {IPixelCoin} from "./interfaces/IPixelCoin.sol";

import {PixNft} from "./PixNft.sol";

/**
 * @title NftOwnerReward
 * @author Matrix
 */
contract NftOwnerReward is AccessControl {
    // ==================== Constants ====================

    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");

    // ==================== Variables ====================

    PixNft internal immutable _pixNft;
    IPixelCoin internal immutable _pixelCoin;

    uint256 internal _rewardPerNft = 54000 * 1e18; // default reward per NFT
    mapping(uint256 => address) internal _recipients; // tokenId => account address
    mapping(uint256 => bool) internal _isClaimed; // tokenId => account => whether claimed

    // ==================== Events ====================

    event NewNftOwnerReward(address pixNft, address pixelCoin);
    event SetRewardPerNft(uint256 oldRewardPerNft, uint256 newRewardPerNft);
    event NftOwnerClaim(uint256 indexed nftId, address indexed contributor, uint256 amount);

    // ==================== Constructor function ====================

    constructor(address pixNft, address pixelCoin) {
        require(pixNft != address(0), "zero pixNft");
        require(pixelCoin != address(0), "zero pixelCoin");

        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
        _setupRole(ADMIN_ROLE, _msgSender());

        _pixNft = PixNft(pixNft);
        _pixelCoin = IPixelCoin(pixelCoin);

        emit NewNftOwnerReward(pixNft, pixelCoin);
    }

    // ==================== Modifier functions ====================

    modifier onlyAdmin() {
        _onlyAdmin();
        _;
    }

    // ==================== External functions ====================

    function getPixNft() external view returns (address) {
        return address(_pixNft);
    }

    function getPixelCoin() external view returns (address) {
        return address(_pixelCoin);
    }

    function getRewardPerNft() external view returns (uint256) {
        return _rewardPerNft;
    }

    function setRewardPerNft(uint256 newRewardPerNft) external onlyAdmin {
        uint256 oldRewardPerNft = _rewardPerNft;
        _rewardPerNft = newRewardPerNft;

        emit SetRewardPerNft(oldRewardPerNft, newRewardPerNft);
    }

    function getClaimeInfo(uint256 nftId, address contributor) external view returns (bool isClaimed, uint256 amount) {
        if (contributor == _pixNft.ownerOf(nftId)) {
            isClaimed = _isClaimed[nftId];
            amount = _rewardPerNft;
        }
    }

    function claim(uint256 nftId, address contributor) external {
        require(contributor == _pixNft.ownerOf(nftId), "not nft owner");
        require(!_isClaimed[nftId], "already claimed");

        _isClaimed[nftId] = true;
        _recipients[nftId] = contributor;

        uint256 reward = _rewardPerNft;
        _pixelCoin.mint(contributor, reward);

        emit NftOwnerClaim(nftId, contributor, reward);
    }

    // ==================== Private functions ====================

    function _onlyAdmin() private view {
        require(hasRole(ADMIN_ROLE, _msgSender()), "not admin");
    }
}
